import CommentItem from './CommentItem';
import Comment from '../types/Comment';

import React from 'react';

const CommentList: React.FC = () => {
    return (
        <ul>
            {comments.map((comment) => (
                <CommentItem comment={comment} key="" />
            ))}
        </ul>
    );
};

export default CommentList;
